import React from "react";

import {
    BrowserRouter as Router,
    Routes,
    Route,
    Link,
  } from "react-router-dom";

import Linkbox from "./linkbox";

import {
    AiFillCustomerService,
    AiFillHome
  } from "react-icons/ai";

const Home = () => {
    return (
        <div>
            <div className="content-1">
                <img src="nokeif-logo.svg" className="home-img"></img>
                <div className="pdb">
                    <Linkbox title="Spotify" url="https://open.spotify.com/artist/3AoiNh85pj8qfchXmgeh43?si=ziPF19-ZT2mLHHpfU2t-Pw" />
                    <Linkbox title="TikTok" url=""/>
                    <div className="linkbox maxw-400">
                        <div className="linkbox-link">
                            {/* <span class="icon"><AiFillHome /></span> */}
                            <Link to={`/`} class="listlink">TikTok</Link>
                        </div>
                    </div>
                    <div className="linkbox maxw-400">
                        <div className="linkbox-link">
                            {/* <span class="icon"><AiFillHome /></span> */}
                            <a href="https://music.apple.com/us/artist/nokeif/id1478583810" target="_blank">Apple Music</a>
                        </div>
                    </div>
                </div>





            </div>
        </div>
    );
};

export default Home;
